import React, { Component } from 'react'
import axios from 'axios'

export default class CreateCalification extends Component {

    state = {
        califications: [],
        califName: ''
    }

    async componentDidMount() {
        const res = await axios.get('http://localhost:3001/api/calif')
        this.setState({movies: res.data})
        console.log(this.state.califications)
    }

    render() {
        return (
            <div className="row">
                <div className="col-md-8">
                    <ul className="list-group">
                        {
                            this.state.califications.map(calif => (
                                <li className="list-group-item list-group-item-action" key={calif._id}>
                                    { calif.name }
                                </li>)
                            )
                        }
                    </ul>
                </div>
                <div className="col-md-4">
                    <div className="card card-body">
                        <h2>Nueva Calificaci√≥n</h2>
                    </div>
                    <form>
                        <div className="form-group">
                            <input className="form-control" type="text">

                            </input>
                        </div>
                    </form>
                </div>
            </div>
        )
    }
}
